// src/App.jsx
import React, { lazy, Suspense } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, Outlet, useLocation } from "react-router-dom";
import { AuthProvider, useAuth } from "./context/AuthContext";
import Layout from "./components/Layout";

// Lazy loaded pages
const Landing = lazy(() => import("./pages/index"));
const Register = lazy(() => import("./pages/register"));
const Login = lazy(() => import("./pages/login"));
const Dashboard = lazy(() => import("./pages/dashboard"));
const KYCStep1 = lazy(() => import("./pages/kyc-step1"));
const KYCStep2 = lazy(() => import("./pages/kyc-step2"));
const KYCStep3 = lazy(() => import("./pages/kyc-step3"));
const KYCStep4 = lazy(() => import("./pages/kyc-step4"));
const KYCStep5 = lazy(() => import("./pages/kyc-step5"));
const Result = lazy(() => import("./pages/result"));

// Lightweight skeleton used during lazy load
function PageFallback() {
  return (
    <div className="min-h-[60vh] flex items-center justify-center">
      <div className="animate-pulse text-center">
        <div className="h-4 w-48 bg-slate-200 rounded mb-4 mx-auto"></div>
        <div className="h-3 w-32 bg-slate-200 rounded mx-auto"></div>
      </div>
    </div>
  );
}

// RequireAuth preserves attempted loc and waits for auth init
function RequireAuth({ children }) {
  const { user, loading } = useAuth();
  const location = useLocation();

  if (loading) return <PageFallback />;

  if (!user) {
    return <Navigate to="/login" state={{ from: location }} replace />;
  }
  return children ? children : <Outlet />;
}

export default function App() {
  return (
    <AuthProvider>
      <Router>
        <Suspense fallback={<PageFallback />}>
          <Routes>
            {/* Public routes (wrapped by Layout) */}
            <Route element={<Layout />}>
              <Route index element={<Landing />} />
              <Route path="register" element={<Register />} />
              <Route path="login" element={<Login />} />
            </Route>

            {/* Protected routes */}
            <Route element={<RequireAuth />}>
              <Route element={<Layout />}>
                <Route path="dashboard" element={<Dashboard />} />
                <Route path="kyc-step1" element={<KYCStep1 />} />
                <Route path="kyc-step2" element={<KYCStep2 />} />
                <Route path="kyc-step3" element={<KYCStep3 />} />
                <Route path="kyc-step4" element={<KYCStep4 />} />
                <Route path="kyc-step5" element={<KYCStep5 />} />
                <Route path="result" element={<Result />} />
              </Route>
            </Route>

            {/* fallback */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </Suspense>
      </Router>
    </AuthProvider>
  );
}
